import {Action} from '../actions/index.js';
const oldState = {
    data:[],
    error: false,
}
export const reducer = (state = oldState, action)=>{
    switch (action.type) {
        case Action.getDataSuccess().type:
            return state;
        case Action.getDataError().type:
            return state;    
        default:
            return state;
    }
}
